  \"devils-lake-wetland-management-district-annual-narrative-report-calendar-year-1977\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Devils Lake Wetland
  Management District outlines District accomplishments for the 1977 calendar year.
  The report begins by giving a brief introduction to the District and describing
  the climate and habitat conditions in the District, as well as the land acquisition
  program, funding, and systems status. The construction and maintenance section describes
  recent construction, maintenance, and wildfires. The habitat management section
  discusses wetlands, croplands, grasslands, and easements for waterfowl management.
  Wildlife- including endangered and threatened species, migratory birds, big game
  animals, and raptors- are discussed. The public relations sections describes information
  and interpretation, recreational uses, and enforcement. Field investigations, cooperative
  programs, items of interest, and safety are discussed. Photographs are attached.\",\n\t\"license_title\":
